import React from 'react';
import HeaderBlock from './components/HeaderBlock';

const App = () => {
  return (
  <React.Fragment>
    <HeaderBlock title="Учите слова онлайн"/>
    <HeaderBlock 
      title="Нам нравится это"
      hideBackground={true}
    />
  </React.Fragment>
  );
}
export default App;
